
window.onUIchange = function(obj) {
calculator.functions.showUnicode(lastCharOrCode, obj);
}

calculator.functions.showUnicode = function(charOrCode, obj) {
charOrCode = calculator.unquote(charOrCode);
obj = calculator.unquote(obj);

var numberFormat = eval("(" + obj + ")").numberFormat;
var character, code;
var result = this.unicode(charOrCode);
if (typeof result == "number") {
character = charOrCode;
code = result;
}
else {
character = result;
code = this.unicode(character);
}

if (numberFormat == 0) code = "0x" + this.decimalToHex(code);
else if (numberFormat == 2) code = this.decimalToOct(code) + "o";
else if (numberFormat == 3) code = this.decimalToBinary(code) + "b";
display.showPage("<span style=''font-size:128px; margin-left:15%''>" + character + "</span>" + " (" + code + ")");
lastCharOrCode = charOrCode;
}
',NULL,'Characters and Codes',NULL);
